import React,{ Component } from 'react';
import axios from 'axios';
import styles from './MoviesAdmin.module.css';
//import firebase from '../../Firebase';

class MoviesAdmin extends Component {

  state = {
  }

  componentDidMount(){
    axios.get('http://34.230.13.18:8080/v1/movies')
      .then((resp) => {
        this.setState({items: resp.data.data});
      })
      .catch((err) => {
        console.log(err);
      });

  }


  render (){

    let itemsList = <tr></tr>;
    if(this.state.items){
      console.log(this.state)
      itemsList = Object.keys(this.state.items)
      .map(key => {
        let item = this.state.items[key];
      return <tr key={key}>
              <td>{item.movie_name}</td>
              <td>{item.mtype_name}</td>
              <td>{item.rented}</td>
             </tr>;
      });
    }


    return (

      <div>
        <table id={styles.customers}>
        <thead>
            <tr>
                <th>Name</th>
                <th>Type</th>
                <th>Availability</th>
            </tr>
        </thead>
        <tbody>
          {itemsList}

        </tbody>
      </table>
      </div>
    );
  }
}

export default MoviesAdmin;
